[[module CSS]]
:root{
  --deg-3: 0.86602540378;
  --deg-4: 1;
  --deg-5: 0.95105651629;
  --deg-6: 0.86602540378;
  --deg-7: 0.78183148246;
  --deg-8: 0.70710678118;
  --deg-9: 0.64278760968;
  --deg-10: 0.58778525229;
  --bg-color: {$bg-color};
  --line-color: {$line-color};
}

#page-content div.circle-{$no} *{
  max-width: none;
}

.circle-{$no}{
  width: {$size};
  height: {$size};
  position: relative;
  text-align: center;
  margin-left: auto;
  margin-right: auto;
  margin-bottom: 1em;
  pointer-events: none;
}

.circle-{$no}.circle-left{
  display: inline-block;
  float: left;
  margin: 0 2em 1em 2em;
}

.circle-{$no}.circle-right{
  display: inline-block;
  float: right;
  margin: 0 2em 1em 2em;
}

@media (max-width: 768px) {
  .circle-{$no}.circle-clear{
    display: block;
    float: none;
    clear: both;
    margin-left: auto;
    margin-right: auto;
  }
}

.circle-{$no} [class$="-box"]{
  position: absolute;
  width: 100%;
  height: 100%;
  left: 0;
  top: 0;
}

.circle-{$no} .bg-box .bg,
.circle-{$no} .graph-box .graph{
  width: 0;
  height: 0;
  left: 50%;
  bottom: 50%;
  position: absolute;
  transform-origin: 0 100%;
}

.circle-{$no} .bg-box div.bg:nth-of-type(2),
.circle-{$no} .graph-box div.graph:nth-of-type(2),
.circle-{$no} .scale-box div.scale:nth-of-type(2),
.circle-{$no} .line-box div.line:nth-of-type(2),
.circle-{$no} .label-box .label:nth-of-type(2){
  transform: rotate(calc(360deg / {$item} * 1));
}
.circle-{$no} .bg-box div.bg:nth-of-type(3),
.circle-{$no} .graph-box div.graph:nth-of-type(3),
.circle-{$no} .scale-box div.scale:nth-of-type(3),
.circle-{$no} .line-box div.line:nth-of-type(3),
.circle-{$no} .label-box .label:nth-of-type(3){
  transform: rotate(calc(360deg / {$item} * 2));
}
.circle-{$no} .bg-box div.bg:nth-of-type(4),
.circle-{$no} .graph-box div.graph:nth-of-type(4),
.circle-{$no} .scale-box div.scale:nth-of-type(4),
.circle-{$no} .line-box div.line:nth-of-type(4),
.circle-{$no} .label-box .label:nth-of-type(4){
  transform: rotate(calc(360deg / {$item} * 3));
}
.circle-{$no} .bg-box div.bg:nth-of-type(5),
.circle-{$no} .graph-box div.graph:nth-of-type(5),
.circle-{$no} .scale-box div.scale:nth-of-type(5),
.circle-{$no} .line-box div.line:nth-of-type(5),
.circle-{$no} .label-box .label:nth-of-type(5){
  transform: rotate(calc(360deg / {$item} * 4));
}
.circle-{$no} .bg-box div.bg:nth-of-type(6),
.circle-{$no} .graph-box div.graph:nth-of-type(6),
.circle-{$no} .scale-box div.scale:nth-of-type(6),
.circle-{$no} .line-box div.line:nth-of-type(6),
.circle-{$no} .label-box .label:nth-of-type(6){
  transform: rotate(calc(360deg / {$item} * 5));
}
.circle-{$no} .bg-box div.bg:nth-of-type(7),
.circle-{$no} .graph-box div.graph:nth-of-type(7),
.circle-{$no} .scale-box div.scale:nth-of-type(7),
.circle-{$no} .line-box div.line:nth-of-type(7),
.circle-{$no} .label-box .label:nth-of-type(7){
  transform: rotate(calc(360deg / {$item} * 6));
}
.circle-{$no} .bg-box div.bg:nth-of-type(8),
.circle-{$no} .graph-box div.graph:nth-of-type(8),
.circle-{$no} .scale-box div.scale:nth-of-type(8),
.circle-{$no} .line-box div.line:nth-of-type(8),
.circle-{$no} .label-box .label:nth-of-type(8){
  transform: rotate(calc(360deg / {$item} * 7));
}
.circle-{$no} .bg-box div.bg:nth-of-type(9),
.circle-{$no} .graph-box div.graph:nth-of-type(9),
.circle-{$no} .scale-box div.scale:nth-of-type(9),
.circle-{$no} .line-box div.line:nth-of-type(9),
.circle-{$no} .label-box .label:nth-of-type(9){
  transform: rotate(calc(360deg / {$item} * 8));
}
.circle-{$no} .bg-box div.bg:nth-of-type(10),
.circle-{$no} .graph-box div.graph:nth-of-type(10),
.circle-{$no} .scale-box div.scale:nth-of-type(10),
.circle-{$no} .line-box div.line:nth-of-type(10),
.circle-{$no} .label-box .label:nth-of-type(10){
  transform: rotate(calc(360deg / {$item} * 9));
}

.circle-{$no} .bg-box .bg .bg-inner{
  width: 0;
  height: 0;
  left: 0;
  bottom: 0;
  position: absolute;
  transform-origin: 0 100%;
  transform: skewY(calc(-90deg + 360deg / {$item}));
  border-style: solid;
  border-color: transparent transparent transparent var(--bg-color);
  border-width: calc({$size}/2) 0 0 calc({$size}/2 * var(--deg-{$item}));
}


.circle-{$no} .graph-box .graph .graph-inner{
  width: 0;
  height: 0;
  left: 0;
  bottom: 0;
  position: absolute;
  transform-origin: 0 100%;
  transform: skewY(calc(-90deg + 360deg / {$item}));
  border-style: solid;
  border-color: transparent transparent transparent {$color};
  border-width: calc({$size}/2) 0 0 calc({$size}/2 * var(--deg-{$item}));
}

.circle-{$no} .graph-box .graph .graph-inner{
  border-width: calc({$size} / {$max} * var(--n) / 2) 0 0 calc({$size} / {$max} * var(--m) / 2 * var(--deg-{$item}));
}

.circle-{$no} .graph-box div.graph:nth-of-type(1) .graph-inner{
  --n: {$data1};
  --m: {$data2};
}
.circle-{$no} .graph-box div.graph:nth-of-type(2) .graph-inner{
  --n: {$data2};
  --m: {$data3};
}
.circle-{$no} .graph-box div.graph:nth-of-type(3) .graph-inner{
  --n: {$data3};
  --m: {$data4};
}
.circle-{$no} .graph-box div.graph:nth-of-type(4) .graph-inner{
  --n: {$data4};
  --m: {$data5};
}
.circle-{$no} .graph-box div.graph:nth-of-type(5) .graph-inner{
  --n: {$data5};
  --m: {$data6};
}
.circle-{$no} .graph-box div.graph:nth-of-type(6) .graph-inner{
  --n: {$data6};
  --m: {$data7};
}
.circle-{$no} .graph-box div.graph:nth-of-type(7) .graph-inner{
  --n: {$data7};
  --m: {$data8};
}
.circle-{$no} .graph-box div.graph:nth-of-type(8) .graph-inner{
  --n: {$data8};
  --m: {$data9};
}
.circle-{$no} .graph-box div.graph:nth-of-type(9) .graph-inner{
  --n: {$data9};
  --m: {$data10};
}
.circle-{$no} .graph-box div.graph:nth-of-type(10) .graph-inner{
  --n: {$data10};
  --m: {$data1};
}

.circle-{$no} .graph-box div.graph:nth-of-type({$item}) .graph-inner{
  --n: {$data{$item}};
  --m: {$data1};
}


.circle-{$no} .scale-box .scale{
  width: 0;
  height: 50%;
  left: 50%;
  bottom: 50%;
  position: absolute;
  transform-origin: 0 100%;
}

.circle-{$no} .scale-box .scale .scale-inner{
  width: 100%;
  height: 100%;
  left: 0;
  bottom: 0;
  position: absolute;
  transform-origin: 0 100%;
  transform: skewY(calc(-90deg + 360deg / {$item})) scaleX(var(--deg-{$item}));
}


.circle-{$no} .scale-box .scale .scale-inner .scale-line{
  position: absolute;
  height: 0;
  left: 0;
  border-style: solid;
  border-color: var(--line-color) transparent transparent transparent;
  border-width: 2px;
  transform-origin: 0 0;
  transform: rotate(45deg);
}

.circle-{$no} .scale-box .scale .scale-inner .scale-line{
  width: calc({$size} / 2 / {$stage} * ({$stage} - var(--k)) * 1.41421356 - 4px);
  top: calc({$size} / 2 / {$stage} * var(--k));
}


.circle-{$no} .line-box .line{
  position: absolute;
  width: 2px;
  height: calc(50% - 1px);
  left: 0;
  right: 0;
  bottom: 50%;
  margin: 0 auto;
  transform-origin: 50% 100%;
  background: var(--line-color);
}

.circle-{$no} .label-box .label{
  position: absolute;
  left: 0;
  right: 0;
  font-weight: 900;
  transform-origin: 50% calc({$size} / 2);
}

.circle-{$no} .label-box .label p{
  display: inline-block;
  margin:0;
}

.circle-{$no} .label-box .label p{
  transform: rotate(calc(-360deg / {$item} * var(--k)));
}

.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(1),
.circle-{$no} .label-box div.label:nth-of-type(1) p{
  --k: 0;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(2),
.circle-{$no} .label-box div.label:nth-of-type(2) p{
  --k: 1;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(3),
.circle-{$no} .label-box div.label:nth-of-type(3) p{
  --k: 2;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(4),
.circle-{$no} .label-box div.label:nth-of-type(4) p{
  --k: 3;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(5),
.circle-{$no} .label-box div.label:nth-of-type(5) p{
  --k: 4;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(6),
.circle-{$no} .label-box div.label:nth-of-type(6) p{
  --k: 5;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(7),
.circle-{$no} .label-box div.label:nth-of-type(7) p{
  --k: 6;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(8),
.circle-{$no} .label-box div.label:nth-of-type(8) p{
  --k: 7;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(9),
.circle-{$no} .label-box div.label:nth-of-type(9) p{
  --k: 8;
}
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(10),
.circle-{$no} .label-box div.label:nth-of-type(10) p{
  --k: 9;
}

.circle-{$no} .bg-box .bg,
.circle-{$no} .graph-box .graph,
.circle-{$no} .scale-box .scale,
.circle-{$no} .scale-box .scale .scale-inner .scale-line,
.circle-{$no} .line-box .line,
.circle-{$no} .label-box .label{
  display: none;
}
.circle-{$no} .bg-box div.bg:nth-of-type(-n + {$item}),
.circle-{$no} .graph-box div.graph:nth-of-type(-n + {$item}),
.circle-{$no} .scale-box div.scale:nth-of-type(-n + {$item}),
.circle-{$no} .scale-box .scale .scale-inner div.scale-line:nth-of-type(-n + {$stage}),
.circle-{$no} .line-box div.line:nth-of-type(-n + {$item}){
  display: block;
}

.circle-{$no} .label-box div.label:nth-of-type(-n + {$item}){
  display: inline-block;
}

.circle-{$no}.sushi .label-box .label{
  color: #000000;
  text-shadow:1px 1px 1px #ffffff,-1px 1px 1px #ffffff,1px -1px 1px #ffffff,-1px -1px 1px #ffffff;
}
